import React from "react";


function ToyDisplayBodyWrapper(props) {
  return (
    <div className="container">
        <div className="row">
        <h2 className="piggy-bank-text">Which toy cost that</h2>
            {props.children}
        </div>
    </div> 
  );
}

export default ToyDisplayBodyWrapper;
